import Playas from './data/playa.json'

const Single = () => {

     const currentRoute = window.location.pathname;
     const playas = Playa.find(it => currentRoute.includes(it.slug))

     return (<>
         <h1>{playas.name}</h1>
           <hr></hr>
           <img src={playa.picture}></img>
           <p>{playa.description}</p>

     </>);

}

export default Single;
